{
  "env": {},
  "globals": {},
  "ecmaFeatures": {},
  "parser": null,
  "rules": {
    "prefer-reflect": 0,
    "no-plusplus": 0,
    "no-return-assign": 0,
    "no-invalid-this": 0,
    "no-void": 0,
    "one-var": 0,
    "no-undef": 2,
    "eol-last": 0,
    "max-nested-callbacks": 0,
    "no-empty": 0,
    "no-loop-func": 0,
    "no-restricted-modules": 0,
    "space-after-keywords": 0,
    "generator-star-spacing": 0,
    "wrap-iife": 0,
    "valid-typeof": 0,
    "handle-callback-err": 0,
    "operator-linebreak": 0,
    "no-label-var": 0,
    "no-process-env": 0,
    "no-irregular-whitespace": 0,
    "padded-blocks": 0,
    "radix": 0,
    "no-undefined": 0,
    "semi-spacing": 0,
    "eqeqeq": 0,
    "wrap-regex": 0,
    "require-yield": 0,
    "new-cap": 0,
    "no-const-assign": 0,
    "no-bitwise": 0,
    "dot-notation": 0,
    "camelcase": 0,
    "prefer-const": 0,
    "no-negated-in-lhs": 0,
    "no-extra-bind": 0,
    "no-sequences": 0,
    "require-jsdoc": 1,
    "comma-dangle": 0,
    "no-spaced-func": 0,
    "no-sync": 0,
    "no-empty-label": 0,
    "no-unreachable": 0,
    "no-eval": 2,
    "func-style": 0,
    "no-unneeded-ternary": 0,
    "no-process-exit": 0,
    "no-empty-character-class": 0,
    "vars-on-top": 0,
    "constructor-super": 0,
    "strict": 0,
    "array-bracket-spacing": [
      2,
      "never",
      {}
    ],
    "block-scoped-var": 0,
    "space-in-parens": 0,
    "no-control-regex": 0,
    "consistent-return": 0,
    "no-console": 0,
    "comma-spacing": 0,
    "no-labels": 0,
    "no-redeclare": 0,
    "computed-property-spacing": 0,
    "no-invalid-regexp": 0,
    "use-isnan": 0,
    "no-new-require": 0,
    "indent": [
      2,
      4,
      {
        "SwitchCase": 1
      }
    ],
    "no-native-reassign": 0,
    "no-func-assign": 0,
    "max-len": [
      1,
      80,
      4,
      {
        "ignoreComments": true,
        "ignoreUrls": true
      }
    ],
    "no-shadow": 0,
    "no-mixed-requires": 0,
    "max-statements": 0,
    "space-unary-ops": 0,
    "space-return-throw-case": 0,
    "no-lone-blocks": 0,
    "no-debugger": 0,
    "arrow-parens": 0,
    "lines-around-comment": 0,
    "space-before-blocks": 0,
    "no-implied-eval": 0,
    "no-multi-spaces": 0,
    "curly": [
      2,
      "all"
    ],
    "no-extra-boolean-cast": 0,
    "space-infix-ops": 0,
    "no-multiple-empty-lines": 0,
    "semi": [
      2,
      "always"
    ],
    "no-param-reassign": 0,
    "no-cond-assign": 0,
    "no-dupe-keys": 0,
    "max-params": 0,
    "no-ternary": 0,
    "linebreak-style": 0,
    "no-octal-escape": 0,
    "no-this-before-super": 0,
    "no-alert": 0,
    "no-unused-expressions": 0,
    "no-class-assign": 0,
    "spaced-comment": 0,
    "no-path-concat": 0,
    "prefer-spread": 0,
    "no-self-compare": 0,
    "guard-for-in": 0,
    "no-nested-ternary": 0,
    "no-multi-str": 0,
    "no-warning-comments": 0,
    "no-delete-var": 0,
    "no-with": 2,
    "no-extra-parens": 0,
    "no-trailing-spaces": 0,
    "no-obj-calls": 0,
    "accessor-pairs": 0,
    "yoda": 0,
    "id-match": 0,
    "no-continue": 0,
    "no-new": 0,
    "object-curly-spacing": [
      2,
      "never",
      {}
    ],
    "key-spacing": 0,
    "no-underscore-dangle": 0,
    "new-parens": 0,
    "no-mixed-spaces-and-tabs": [
      2,
      "smart-tabs"
    ],
    "no-floating-decimal": 0,
    "operator-assignment": 0,
    "init-declarations": 0,
    "no-shadow-restricted-names": 0,
    "no-use-before-define": 0,
    "no-useless-call": 0,
    "no-caller": 0,
    "quotes": 0,
    "brace-style": 0,
    "no-unused-vars": [
      2,
      {
        "args": "none"
      }
    ],
    "no-lonely-if": 0,
    "no-extra-semi": 1,
    "no-else-return": 0,
    "no-dupe-args": 0,
    "no-new-object": 2,
    "callback-return": 0,
    "id-length": 0,
    "no-new-wrappers": 2,
    "comma-style": 0,
    "no-script-url": 0,
    "consistent-this": 0,
    "dot-location": 0,
    "no-implicit-coercion": 0,
    "max-depth": 0,
    "no-array-constructor": 2,
    "no-iterator": 0,
    "sort-vars": 0,
    "no-var": 0,
    "no-sparse-arrays": 0,
    "space-before-function-paren": [
      2,
      "never"
    ],
    "no-throw-literal": 0,
    "no-eq-null": 0,
    "no-inline-comments": 0,
    "no-proto": 0,
    "default-case": 0,
    "no-inner-declarations": [
      2,
      "both"
    ],
    "no-new-func": 0,
    "object-shorthand": 0,
    "no-ex-assign": 0,
    "no-unexpected-multiline": 0,
    "newline-after-var": 0,
    "no-undef-init": 0,
    "no-duplicate-case": 0,
    "no-fallthrough": 0,
    "no-catch-shadow": 0,
    "no-constant-condition": 0,
    "complexity": 0,
    "valid-jsdoc": [
      2,
      {
        "requireReturn": false,
        "prefer": {
          "returns": "return"
        }
      }
    ],
    "no-extend-native": [
      2,
      {
        "exceptions": [
          "Object"
        ]
      }
    ],
    "no-regex-spaces": 0,
    "no-octal": 0,
    "arrow-spacing": 0,
    "quote-props": 0,
    "no-div-regex": 0,
    "func-names": 0
  }
}